import React from "react";
//import { Spinner } from "react-bootstrap";
import useFetchData from "../Hooks/GetAPI"; // Import the custom hook


const url = "https://api.data.gov/ed/collegescorecard/v1/schools?";
// Call the custom hook and pass the URL



function List() {
  const { data: schools, isLoaded, isError } = useFetchData(url);
  if (isError) {
    return <div>Error: Unable to fetch data!</div>;
  }
  if(isLoaded)
    return <div>loading</div>
  
  return (
    <div className=" m-5 text-center">
    <h4>Raghad Page</h4>
    <p>isLoaded</p>
    <p>schools</p>
  </div>
)
}

export default List;
